      <p style={{paddingTop: '10px'}}>React</p>
      <p style={{paddingTop: '10px'}}>HTML</p>
      <p style={{}}>Frontend</p>
      </DivCol>
      <DivCol>
      <h2 style={{paddingTop: '25px'}}>Experience</h2>
      <p style={{paddingTop: '10px'}}>JavaScript</p>
      </DivCol>
    </div>
  );
}

export default About;
